VALUES ('3760039980618', 'Dessert glacé', 'Crème glacée Vanille (43%) : eau, sucre, lait demi-écrémé pasteurisé, jaune d\'œuf, crème, sirop de glucose de mais, de lait écrémé, beurre concentré, gousses de vanille bourbon (0.6%), émulsifiant (mono et diglycérides d\'acides gras), stabilisants de graines de caroube, farine de graines de guar, alginate de sodium et carraghénanes). Crème glacée Noix (43%) : eau, crème sucre, poudre de lait écrémé, purée de noix (fruit à coque) (6.5%), sirop de glucose de mais, émulsifiant (mono et diglycéride-s d\'acides gras), stabilisants (farine de graines de caroube, farine de graines de de sod\\um ex carraghénanes). Génoise imbibée (8%): génoise (fécule de pomme de terre, sucre, oeufs entiers, eau, poudre de blanc d\'eufs, poudre lever (diphosphate, carbonates de sodium), émulsifiant (mono et diglycérides d\'acides gras), sel), eau, sucre. Décor (6%) : brisures de noix (noix (fruit à coque), sucre, beurre de cacao), chocolat (beurre de cacao, sucre, colorant (dioxyde de titane)).', 'https://static.openfoodfacts.org/images/products/376/003/998/0618/front_fr.4.400.jpg', '9.4', '6.3', '25', '18', '0', '4.3', '0.05', '0.0196850393700787', '', '1');

